import React from "react";

const RightSidebarFirst = () => {
  return (
    <div className="w-1/4 p-6">
      <div className="flex flex-col items-start gap-3">
        <p className="text-3xl font-extrabold text-[#1b475d]">
          UniWalls! a giriş yap
        </p>
        <p className="text-lg font-semibold text-[#90beab]">kampüs</p>
        <p className="text-lg font-semibold text-[#1b475d]">hayatını</p>
        <p className="text-lg font-semibold text-[#ff7c5c]">dijitalde</p>
        <p className="text-lg font-semibold text-[#90beab]">yaşa</p>
      </div>
    </div>
  );
};

export default RightSidebarFirst;
